import React from "react";
import "./style.css";

function Card(props) {
  return (
    <div className="card">
      <div className="img-container">
        <img alt="" src="" />
      </div>
      <div className="content">
        <ul>
          <li>
            <strong>Name:</strong>
          </li>
          <li>
            <strong>Occupation:</strong>
          </li>
          <li>
            <strong>Location:</strong>
          </li>
        </ul>
      </div>

    </div>
  );
}

export default Card;
